epage v1.4.3</td>\r\n<td>displayTopColumn</td>\r\n<td>1</td>\r\n</tr><tr><td>Theme configurator v1.1.7</td>\r\n<td>displayTopColumn</td>\r\n<td>2</td>\r\n</tr><tr><td>Contact block v1.3.2</td>\r\n<td>displayNav</td>\r\n<td>1</td>\r\n</tr><tr><td>Cart block v1.5.2</td>\r\n<td>displayNav</td>\r\n<td>2</td>\r\n</tr><tr><td>Currency block v0.3.1</td>\r\n<td>displayNav</td>\r\n<td>3</td>\r\n</tr><tr><td>Language block v1.3.2</td>\r\n<td>displayNav</td>\r\n<td>4</td>\r\n</tr><tr><td>User info block v0.3.1</td>\r\n<td>displayNav</td>\r\n<td>5</td>\r\n</tr><tr><td>Quick search block v1.5.2</td>\r\n<td>displayNav</td>\r\n<td>6</td>\r\n</tr></tbody></table><h3>2. Configuring images</h3>\r\n<p>In PrestaShop you can use predefined image dimensions for product images, category images, manufacturers etc.</p>\r\n<p>For example, images of the <strong>\'home\'</strong> dimensions are usually used for the category listing product images, <strong>\'large\'</strong> for main product image on the product info page.</p>\r\n<p>To configure product image dimensions, open your PrestaShop admin panel, go to <strong>Preferences &gt; Images</strong> and set the image dimensions as displayed below:</p>\r\n<table class=\"table table-bordered table-hover\"><tbody><tr><th>Picture</th><th>Width (px)</th><th>Height (px)</th></tr><tr><td>small_default</td>\r\n<td>98</td>\r\n<td class=\"presta_center\">98</td>\r\n</tr><tr><td>medium_default</td>\r\n<td>125</td>\r\n<td class=\"presta_center\">125</td>\r\n</tr><tr><td>home_default</td>\r\n<td>270</td>\r\n<td class=\"presta_center\">270</td>\r\n</tr><tr><td>large_default</td>\r\n<td>458</td>\r\n<td class=\"presta_center\">458</td>\r\n</tr><tr><td>thickbox_default</td>\r\n<td>800</td>\r\n<td class=\"presta_center\">800</td>\r\n</tr><tr><td>category_default</td>\r\n<td>870</td>\r\n<td class=\"presta_center\">217</td>\r\n</tr><tr><td>scene_default</td>\r\n<td>520</td>\r\n<td class=\"presta_center\">189</td>\r\n</tr><tr><td>m_scene_default</td>\r\n<td>161</t